// Shopping.js
import React from "react";
import ShoppingSection from "../../components/ShoppingSection"; // Adjust the path as necessary

function Shopping() {
  document.title = "Shopping";
  return (
      <div>
        <ShoppingSection />
      </div>
  );
}

export default Shopping;
